import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  Paper,
  Grid,
  TextField,
  Box,
  Typography,
  Avatar,
  Button
} from "@material-ui/core";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import LocationOnIcon from "@material-ui/icons/LocationOn";
import List from "@material-ui/core/List";

const useStyles = makeStyles(theme => ({
  root: {
    padding: theme.spacing(2, 3)
  },
  avatar: {
    margin: theme.spacing(2, 1),
    maxWidth: 350
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3)
  },
  toolbar: theme.mixins.toolbar
}));

export default function PaperSheet() {
  const classes = useStyles();

  return (
    <Paper className={classes.root}>
      <Grid>
        <main className={classes.content}>
          <Box display="flex">
            <Avatar
              alt="profile"
              src="https://randomuser.me/api/portraits/women/8.jpg"
              style={{ height: 200, width: 200 }}
            ></Avatar>
            <Typography ml={2}>
              <h1>Carol Lin</h1>

              <ListItemIcon>
                <LocationOnIcon />
                <Typography>Singapore</Typography>
              </ListItemIcon>
              <ListItemText />

              <Typography>
                <span>30 years old</span>
              </Typography>
            </Typography>
          </Box>
        </main>

        <Typography>
          Carol is a passionate instructor who believes yoga and breath can
          change someone's life. She credits her first yoga class as one of the
          best things that ever happened to her. Yoga has given her the tools to
          get out of her head and thrive in the present moment. In 2012 she
          decided to take her 200 hour YTT so she could not only deepen her
          practice but share it with others. Her classes have a theme of
          connecting breath and movement, presence and the unfolding of
          possibilities in every moment. Having deep rooted values in the
          importance of community, Ayla is so excited to create this magical
          experience of bringing people together.
        </Typography>

        <Box component="span" mt={5}>
          <Button
            size="small"
            type="submit"
            variant="contained"
            color="primary"
            className={classes.submit}
            style={{ background: "#E83350" }}
          >
            Connect
          </Button>
        </Box>
      </Grid>
    </Paper>
  );
}
